import React from 'react'
import TextField from '@mui/material/TextField';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Grid from '@mui/material/Grid';

function Employee() {
  return (
     <div>
          <Grid container spacing={3} style={{padding: '3rem'}}>
            <Grid item  md={4}></Grid>
            <Grid item  md={4}>
              <Card>
                <CardContent>
                  <TextField id="outlined-basic" label="Employee Name" variant="outlined" />
                  <br/>
                  <TextField id="outlined-basic" label="Employee Number" variant="outlined" />
                  <br/>
                  <TextField id="outlined-basic" label="Age" variant="outlined" />
                  <br/>
                </CardContent>
                <CardActions>
                  <Button variant="contained" size="small">Add Details</Button>
                </CardActions>
              </Card>
            </Grid>
            <Grid item  md={4}></Grid>
          </Grid>
     </div>
  )
}

export default Employee
